$str$, $str$When Claudius crashes, becomes unreachable, or times out - check if swap is enabled first$str$, $str$Enable swap: fallocate -l 4G /swapfile && chmod 600 /swapfile && mkswap /swapfile && swapon /swapfile && echo '/swapfile none swap sw 0 0' >> /etc/fstab$str$, $str${"source":"claude-code-mcp","storage_method":"manual","surprise_score":1,"surprise_detected":true}$str$::jsonb, 0.975, $str$claude-code$str$, '{}', '{}', '{"claudius","crashed","again","2026","night","watch","analysis","root","cause","swap"}', TRUE, $str$direct_experience$str$, 0, NULL, $str$2026-01-16T16:58:50.167855+00:00$str$, NULL, FALSE, $str$2026-01-16T16:58:50.167855+00:00$str$) ON CONFLICT (id) DO NOTHING;
