dius-api 3) Long-term: add concurrency limiting to night-watch$str$, $str${"source":"claude-code-mcp","storage_method":"manual","surprise_score":1,"original_length":670,"original_content":"Claudius \"fetch failed\" errors are caused by resource exhaustion from too many concurrent claude CLI sessions. Each claude session spawns ~15 MCP server child processes (context7, stripe, supabase, workspace-mcp, chrome-devtools-mcp, etc.). When night-watch runs multiple auto-fix cycles, it can spawn 6+ claude sessions = 500+ threads, hitting the systemd TasksMax=500 limit. Node.js then fails with \"Assertion failed: uv_thread_create\" when it can't create new threads. Fix: Restart claudius-api service and kill stale claude processes. Prevention: Add semaphore-based concurrency limiting (MAX_CONCURRENT_FIXERS=2) to spawn_claude_fixer function in night-watch-v3.py.","surprise_detected":true}$str$::jsonb, 1, $str$claude-code$str$, '{}', '{}', '{"claudius","fetch","failed","errors","caused","resource","exhaustion","many","concurrent","claude"}', TRUE, $str$direct_experience$str$, 0, NULL, $str$2026-01-16T17:51:54.006498+00:00$str$, NULL, FALSE, $str$2026-01-16T17:51:54.006498+00:00$str$) ON CONFLICT (id) DO NOTHING;
