cron job at /opt/claudius/google-token-refresh.py runni...$str$, $str$When asked about calendar notifications, proactive reminders, meeting nudges, or morning briefings$str$, $str$System uses simple polling (every 5 mins) rather than push notifications - more reliable, less complex. Cron entries: 8am for briefing, */5 for nudges, */45 for token refresh.$str$, $str${"source":"claude-code-mcp","storage_method":"auto","surprise_score":1,"original_length":517,"original_content":"Calendar Nudge System Implementation: Two-part cron system for proactive calendar notifications. 8am daily briefing shows all events for the day. Every 5 minutes checks for events starting in 28-33 minute window and sends nudge. Script at /opt/claudius/calendar-nudge.py uses Google Calendar API directly with stored OAuth credentials. Nudges tracked in /tmp/calendar_nudges_sent.json to prevent duplicates. Token refresh handled by separate cron job at /opt/claudius/google-token-refresh.py running every 45 minutes.","surprise_detected":true}$str$::jsonb, 0.39, $str$claude-code$str$, '{}', '{}', '{"calendar","nudge","system","implementation","part","cron","system","proactive","calendar","notifications"}', TRUE, $str$direct_experience$str$, 0, NULL, $str$2026-01-07T22:23:21.432316+00:00$str$, NULL, FALSE, $str$2026-01-11T14:17:34.598477+00:00$str$) ON CONFLICT (id) DO NOTHING;
