overy: SSH to server, ran docker-compose up -d, services restored in under 2 minutes. Also found health-monitor.sh had permission denied er...$str$, $str$When containers disappear from production, when investigating Docker outages, when hasBeenManuallyStopped appears in logs$str$, $str$SSH direct to server (port 22222), run docker-compose up -d to restore. Check health-monitor.sh permissions.$str$, $str${"source":"claude-code-mcp","storage_method":"auto","surprise_score":1,"original_length":641,"original_content":"Production outage on 2026-01-08 ~20:53 UTC: All Docker containers (omniops-app, omniops-redis) disappeared. Docker logs showed \"hasBeenManuallyStopped=true\" and \"restart canceled\" indicating containers were deliberately stopped with docker-compose down, not crashed. Root cause unclear but bash history showed someone running \"claude\" commands on server. Recovery: SSH to server, ran docker-compose up -d, services restored in under 2 minutes. Also found health-monitor.sh had permission denied errors (fixed with chmod +x). Investigation: GH Actions runner was idle (not the cause), no obvious automation that would run docker-compose down.","surprise_detected":true}$str$::jsonb, 1, $str$claude-code$str$, '{}', '{}', '{"production","outage","2026","docker","containers","omniops","omniops","redis","disappeared","docker"}', TRUE, $str$direct_experience$str$, 0, NULL, $str$2026-01-08T20:57:25.168707+00:00$str$, NULL, FALSE, $str$2026-01-11T14:17:34.598477+00:00$str$) ON CONFLICT (id) DO NOTHING;
