d in /opt/claudius/calendar-nudge-credentials.json. Token refresh h...$str$, $str$When asked about calendar reminders, meeting nudges, morning briefings, or how the calendar notification system works$str$, $str$Cron-based polling every 5 mins for nudges, daily 8am for briefings, 45-min token refresh$str$, $str${"source":"claude-code-mcp","storage_method":"auto","surprise_score":1,"original_length":826,"original_content":"Calendar nudge system implementation: Two cron jobs handle all calendar notifications. 1) Morning briefing at 8am (0 8 * * *) runs /opt/claudius/calendar-nudge.py --briefing to fetch today events and send Telegram summary. 2) Meeting nudges every 5 mins (*/5 * * * *) runs /opt/claudius/calendar-nudge.py --nudge to check for events starting in 28-32 min window and send reminders. Uses Google Calendar API with OAuth tokens stored in /opt/claudius/calendar-nudge-credentials.json. Token refresh handled separately by /opt/claudius/google-token-refresh.py running every 45 mins (*/45 * * * *). Logs go to /opt/claudius/logs/calendar.log. This approach chosen over Google push notifications for simplicity - no webhooks, no channel renewals, no event database needed. Tradeoff: meetings added <30 mins out might get late nudge.","surprise_detected":true}$str$::jsonb, 0.39, $str$claude-code$str$, '{}', '{}', '{"calendar","nudge","system","implementation","cron","jobs","handle","calendar","notifications","morning"}', TRUE, $str$direct_experience$str$, 0, NULL, $str$2026-01-07T22:25:33.315157+00:00$str$, NULL, FALSE, $str$2026-01-11T14:17:34.598477+00:00$str$) ON CONFLICT (id) DO NOTHING;
