ding retry logic with backoff for reliability. Now emails are classified by understanding context, not keyword matching.$str$, $str$When troubleshooting Claudius email labeling or Gmail classification issues$str$, $str$Remove keyword fallback, use pure AI classification with context-aware rules in the prompt$str$, $str${"source":"claude-code-mcp","storage_method":"auto","surprise_score":1,"surprise_detected":true}$str$::jsonb, 0.39, $str$claude-code$str$, '{}', '{}', '{"claudius","gmail","smart","labels","misclassifying","emails","keyword","fallback","word","billing"}', TRUE, $str$direct_experience$str$, 0, NULL, $str$2026-01-10T19:43:58.049298+00:00$str$, NULL, FALSE, $str$2026-01-11T14:17:34.598477+00:00$str$) ON CONFLICT (id) DO NOTHING;
