INSERT INTO agent_memories (id, embedding, memory_type, content, trigger_situation, resolution, context, salience_score, source_agent, related_memories, updated_by, keywords, is_verified, verification_method, retrieval_count, last_retrieved_at, created_at, consolidated_at, is_consolidated, updated_at) VALUES ($str$493f6e76-76c9-4fd6-9b55-ed5c14ae0a75$str$, NULL, $str$procedural$str$, $str$Gmail API can return success without actually sending emails. On 2026-01-07, an email to Toby appeared to send but never arrived. Silent failures are dangerous.$str$, $str$When sending any email via Gmail MCP tools$str$, $str$Implemented Send-Then-Verify Protocol: 1) Send email, 2) Wait 2-3 seconds, 3) Search Sent folder with "to:X subject:Y in:sent newer_than:1m", 4) Only confirm if found, 5) Retry once if missing, 6) Warn user if still fails after retry.$str$, $str${"storage_method":"manual"}$str$::jsonb, 0.95, $str$claudius$str$, '{}', '{}', '{"email","gmail","verification","silent-failure","send-verify","mcp"}', TRUE, $str$direct_experience$str$, 0, NULL, $str$2026-01-07T18:45:42.449713+00:00$str$, NULL, FALSE, $str$2026-01-11T14:17:34.598477+00:00$str$) ON CONFLICT (id) DO NOTHING;
