INSERT INTO agent_memories (id, embedding, memory_type, content, trigger_situation, resolution, context, salience_score, source_agent, related_memories, updated_by, keywords, is_verified, verification_method, retrieval_count, last_retrieved_at, created_at, consolidated_at, is_consolidated, updated_at) VALUES ($str$ba30b8ee-4889-4c29-afcb-d4b55d888d0e$str$, NULL, $str$procedural$str$, $str$Docker build cache accumulated to 29GB and unused images to 16GB (45GB total reclaimable). Server disk at 22% (63GB/301GB used). 10 zombie processes present.$str$, $str$When disk usage increases or during routine maintenance checks$str$, $str$Run docker builder prune and docker image prune to reclaim space$str$, $str${"storage_method":"manual"}$str$::jsonb, 0.6, $str$claudius$str$, '{}', '{}', '{"docker","disk","cache","maintenance","cleanup"}', TRUE, NULL, 0, NULL, $str$2026-01-01T02:19:40.068064+00:00$str$, NULL, FALSE, $str$2026-01-11T14:17:34.598477+00:00$str$) ON CONFLICT (id) DO NOTHING;
INSERT INTO agent_memories (id, embedding, memory_type, content, trigger_situation, resolution, context, salience_score, source_agent, related_memories, updated_by, keywords, is_verified, verification_method, retrieval_count, last_retrieved_at, created_at, consolidated_at, is_consolidated, updated_at) VALUES ($str$70e55f7d-786e-4cc5-906e-4e938607bbf6$str$, NULL, $str$procedural$str$, $str$Claudius API experiencing repeated crashes requiring auto-restart (6, 7, 4 consecutive failures). Root cause: systemd service file (docs/server/claudius-api.service) has NO resource limits - no MemoryMax, CPUQuota, TasksMax. Python service uses ThreadingHTTPServer with unbounded thread spawning. Each thread holds Claude CLI context. Memory grows unbounded until OOM killer terminates process. Doctor Agent auto-heals symptoms but doesn't fix root cause. Aggressive restart policy (RestartSec=5, Restart=always) causes rapid restart loops.$str$, $str$When deploying long-running Python services, investigating repeated service crashes, or seeing OOM killer events$str$, $str$Add systemd resource limits: MemoryMax=1G, MemoryHigh=800M (soft limit for throttling), CPUQuota=200%, TasksMax=100. Change restart policy to Restart=on-failure with RestartSec=10, StartLimitBurst=5, StartLimitIntervalSec=300. Add log rotation. For production services, ALWAYS set resource limits to prevent OOM, thread explosion, and rapid restart loops.$str$, $str${"storage_method":"manual"}$str$::jsonb, 0.9, $str$claude-code$str$, '{}', '{}', '{"systemd","resource-limits","memory-exhaustion","claudius","crashes","oom-killer","threading","python-services"}', TRUE, $str$direct_input$str$, 0, NULL, $str$2025-12-31T20:42:46.759394+00:00$str$, NULL, FALSE, $str$2026-01-11T14:17:34.598477+00:00$str$) ON CONFLICT (id) DO NOTHING;
