tname resolution errors$str$, $str$Add extra_hosts mapping in docker-compose.yml: extra_hosts: ["host.docker.internal:host-gateway"]. This maps host.docker.internal to the Docker gateway IP, allowing containers to reach host services.$str$, $str${"source":"claude-code-mcp","storage_method":"manual","surprise_score":1,"surprise_detected":true}$str$::jsonb, 0.39, $str$claude-code$str$, '{}', '{}', '{"docker","containers","cannot","resolve","host","docker","internal","default","linux","unlike"}', TRUE, $str$direct_experience$str$, 2, $str$2026-01-19T14:49:16.474725+00:00$str$, $str$2026-01-19T14:37:34.204946+00:00$str$, NULL, FALSE, $str$2026-01-19T14:49:16.474725+00:00$str$) ON CONFLICT (id) DO NOTHING;
